const buttonStyle = {
    justifyContent: "center"
};

function Home() {
    return (
        <form>
            <div className="form-group">
                <label htmlFor="exampleDate">Email address</label>
                <input type="date" className="form-control" id="exampleDate" placeholder="Дата вывоза"/>
                <small id="emailHelp" className="form-text text-muted">Укажите</small>
            </div>
            <div className="form-group">
                <label htmlFor="exampleInputPassword1">Password</label>
                <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Password"/>
            </div>
        </form>
    );
}

export default Home;
